    font-size : 1.5em;
    text-align: center;
`;

class Main extends React.Component {
    state = {users: []}
    componentDidMount(){
        fetch('/')
            .then(res => res.json())
            .then()
    }
    render(){
        return ( 
            <Html>
            <div>
                <Title> 
                    List af táknmálstúlkum
                </Title>
            </div>
        </Html>
        );
    }
}

export default Main;
